info.description:
# Introduction
Provides access to FastTrack One

# Overview
To access any functionality in FastTrack One a user must be logged in

# Authentication
To access any functionality in FastTrack One a user must be logged in

# Error Codes

Possible status codes
500 InternalServerError
401 Unauthorized
201 Created
200 Ok


# Error Message
These are messages return in the meta data objkect 
The error messages will have some text and code that is documented in the API its self.  



# Sampling Parameters

Some API return list of data and require sample size information.   

The sample size is used to determijne how many records are sampled and the sample age specifies how many units old the data can be that is sampled.

A sample age type is determined by the method being called and the documentation should reflect if it is years, months, day, hours or minutes.


# Result with Meta Data

Results return the results and meta data

```
interface Meta<T>: Wrap<T> {
   error: string (nullable)
   dateCreated: string
   totalNumberRows: int
   take: int
   skip: int
}
```

# Result Wrapper  

Results are always wrapped  


```
interface Wrap<T> {
   result: T
}
```

A result gets wrapped. The meta data provides meta information for the result.  

---

# API Exception Handler

The following error codes are known to the API Error Handler.  

## ArgumentNullException  

```
{
   ErrorCode = 400,
   "ErrorMessage" : "Bad Request (F1.2)",
   "StatusCode": 500
}
```



## ArgumentOutOfRangeException  

```
{
   ErrorCode = 400,
   "ErrorMessage" : "Bad Request (F1.3)",
   "StatusCode": 500
}
```



## ArgumentOutOfRangeException  

```
{
   ErrorCode = 400,
   "ErrorMessage" : "Bad Request (F1.1)",
   "StatusCode": 500
}
```


## Catch all   

```
{
   ErrorCode = 500,
   "ErrorMessage" : "Internal Server Error (F1)",
   "StatusCode": 500
}
```

